import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the featured products grid to be present
    await page.waitForSelector('#productsGrid', { timeout: 5000 });

    // Wait for at least one product card to be visible
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Take screenshot before opening modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_modal.png'));

    // Click the first product card to open the Product Detail Modal
    const productCard = await page.$('.product-card');
    if (!productCard) throw new Error('No product card found to click');
    await productCard.click();

    // Wait for the modal to appear
    await page.waitForSelector('#productModal', { state: 'visible', timeout: 5000 });

    // Wait for the modal content to be loaded (product-detail)
    await page.waitForSelector('#productDetail', { timeout: 5000 });

    // Take screenshot of the open modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_open.png'));

    // Extract some product detail data from the modal for verification
    const modalVisible = await page.$eval('#productModal', el => window.getComputedStyle(el).display !== 'none');
    const productTitle = await page.$eval('#productDetail .product-detail-title', el => el.textContent.trim());
    const productPrice = await page.$eval('#productDetail .product-detail-price', el => el.textContent.trim());

    return {
      success: true,
      action: "Opened Product Detail Modal by clicking a product card and verified modal content.",
      extractedData: {
        modalVisible,
        productTitle,
        productPrice
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
